        graph[v].add(u)
        graph[u].add(v)

    def depth(node):
        # return the number of nodes that are reachable from this node
        count = 1
        for child in graph[node]:
            count += depth(child)
        return count

    def diameter(node):
        # given node, return the longest path to any leaf node
        max_depth = 0
        for child in graph[node]:
            if max_depth < depth(child):
                max_depth = depth(child)
                max_depth_node = child
        return max_depth + 1

    max_diameter = 0
    for node in graph:
        d = diameter(node)
        if d > max_diameter:
            max_diameter = d

    # make a new graph
    graph2 = {}
    for i in range(n):
        graph2[i + 1] = set()

    for _ in range(m):
        v, u = [int(x) for x in stdin.split(' ')]
        # add all the children of v to the children of u
        for child in graph[v]:
            graph2[u].add(child)
            graph2[child].add(u)

    # now find the new diameter
