    for i in range(n):
        for j in range(i + 1, n):
            # If there is an attacking queen, then this is not a valid
            # solution.
            if queens[i] == queens[j]:
                return "INCORRECT"
            if abs(queens[i][0] - queens[j][0]) == abs(
                queens[i][1] - queens[j][1]
